export const primaryColors = {
  islandgreen: "#8ddac1",
  islandyellow: "#ffdf5d",
  white: "#f1f1f1",
  cream: "#fbffd8",
  darkgreen: "#384e53",
};

export const secondaryColors = {
  rose: "#fdb8c5",
  orange: "#e69d6e",
  brown: "#544436",
  purple: "#d19fff",
  red: "#ec5b5b",
  green: "#6bae39",
};

export const fonts = {};
